import React from "react";
import { Dropdown, Button } from "semantic-ui-react";
import { Link } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";

const friendOptions = [
  {
    key: "Jenny Hess",
    text: "ad soyad",
    value: "Jenny Hess",
    image: { avatar: true, src: "/../../public/logo192.png" },
  },
];
const { currentUser, signout } = useAuth();

const DropdownExampleInline = () => (
  <div style={{ marginTop: "14%" }}>
    <Dropdown text="Profile" inline onChange={(e) => console.log(e.state)}>
      <Dropdown.Menu>
        <Dropdown.Item>
          <Link to="404NotFound">
            <Button>EditProfile</Button>
          </Link>
        </Dropdown.Item>
      </Dropdown.Menu>
    </Dropdown>
  </div>
);

export default DropdownExampleInline;
